import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import { useWallet } from '../hooks/useWallet';

export const TokenDetailPage: React.FC = () => {
  const { tokenId } = useParams<{ tokenId: string }>();
  const { isConnected } = useWallet();
  const [purchaseAmount, setPurchaseAmount] = useState('');
  const [isPurchasing, setIsPurchasing] = useState(false);

  // Mock token data
  const token = {
    id: tokenId,
    name: 'Moon Coin',
    symbol: 'MOON',
    description: 'A token that aims for the moon! ðŸš€',
    currentPrice: '0.001234',
    marketCap: '50,000',
    volume24h: '5,000',
    priceChange24h: 15.5,
    holderCount: 42,
    launchProgress: 65,
    isLaunched: false,
    totalSupply: '1,000,000',
    tokensSold: '650,000',
    xlmRaised: '6.5',
    launchThresholdXlm: '10',
    creatorAddress: 'GXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX',
    contractAddress: 'CXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX',
    createdAt: new Date().toISOString(),
  };

  const handlePurchase = async (e: React.FormEvent) => {
    e.preventDefault();
    if (!isConnected) {
      alert('Please connect your wallet first');
      return;
    }

    if (!purchaseAmount || parseFloat(purchaseAmount) <= 0) {
      alert('Please enter a valid XLM amount');
      return;
    }

    setIsPurchasing(true);
    try {
      // TODO: Implement purchase logic
      console.log('Purchasing tokens with XLM:', purchaseAmount);
      
      // Simulate API call
      await new Promise(resolve => setTimeout(resolve, 2000));
      
      alert('Purchase successful! (This is a demo)');
      setPurchaseAmount('');
    } catch (error) {
      console.error('Error purchasing tokens:', error);
      alert('Failed to purchase tokens');
    } finally {
      setIsPurchasing(false);
    }
  };

  const calculateTokensReceived = (xlmAmount: string): string => {
    if (!xlmAmount || parseFloat(xlmAmount) <= 0) return '0';
    
    // Simple calculation for demo (in real app, this would use bonding curve)
    const xlm = parseFloat(xlmAmount);
    const price = parseFloat(token.currentPrice);
    return (xlm / price).toFixed(2);
  };

  return (
    <div className="max-w-6xl mx-auto space-y-8">
      {/* Token Header */}
      <div className="card">
        <div className="flex flex-col md:flex-row md:items-center md:justify-between mb-6">
          <div>
            <h1 className="text-3xl font-bold mb-2">{token.name}</h1>
            <p className="text-gray-600 text-lg">{token.symbol}</p>
            {token.description && (
              <p className="text-gray-700 mt-2">{token.description}</p>
            )}
          </div>
          
          <div className={`mt-4 md:mt-0 px-4 py-2 rounded-full text-sm font-medium ${
            token.isLaunched 
              ? 'bg-green-100 text-green-800' 
              : 'bg-blue-100 text-blue-800'
          }`}>
            {token.isLaunched ? 'ðŸš€ Launched on DEX' : 'ðŸ“ˆ Bonding Curve Active'}
          </div>
        </div>

        {/* Key Metrics */}
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
          <div>
            <div className="text-2xl font-bold text-blue-600">{token.currentPrice} XLM</div>
            <div className="text-sm text-gray-600">Current Price</div>
          </div>
          <div>
            <div className="text-2xl font-bold text-green-600">{token.marketCap} XLM</div>
            <div className="text-sm text-gray-600">Market Cap</div>
          </div>
          <div>
            <div className="text-2xl font-bold text-purple-600">{token.volume24h} XLM</div>
            <div className="text-sm text-gray-600">24h Volume</div>
          </div>
          <div>
            <div className="text-2xl font-bold text-orange-600">{token.holderCount}</div>
            <div className="text-sm text-gray-600">Holders</div>
          </div>
        </div>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        {/* Purchase Widget */}
        <div className="lg:col-span-1">
          <div className="card sticky top-4">
            <h2 className="text-xl font-semibold mb-4">
              {token.isLaunched ? 'Trade on DEX' : 'Buy Tokens'}
            </h2>
            
            {token.isLaunched ? (
              <div className="text-center py-8">
                <p className="text-gray-600 mb-4">
                  This token has launched and is now trading on the Stellar DEX.
                </p>
                <button className="btn-primary w-full">
                  Trade on Stellar DEX
                </button>
              </div>
            ) : (
              <form onSubmit={handlePurchase} className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    XLM Amount
                  </label>
                  <input
                    type="number"
                    value={purchaseAmount}
                    onChange={(e) => setPurchaseAmount(e.target.value)}
                    className="input-field"
                    placeholder="0.1"
                    min="0.0000001"
                    step="0.0000001"
                  />
                </div>

                {purchaseAmount && (
                  <div className="bg-gray-50 p-3 rounded-md">
                    <div className="text-sm text-gray-600">You will receive:</div>
                    <div className="text-lg font-semibold">
                      {calculateTokensReceived(purchaseAmount)} {token.symbol}
                    </div>
                  </div>
                )}

                <button
                  type="submit"
                  disabled={!isConnected || isPurchasing || !purchaseAmount}
                  className="w-full btn-primary"
                >
                  {isPurchasing ? (
                    <div className="flex items-center justify-center space-x-2">
                      <div className="w-4 h-4 border-2 border-white border-t-transparent rounded-full animate-spin"></div>
                      <span>Purchasing...</span>
                    </div>
                  ) : (
                    'Buy Tokens'
                  )}
                </button>

                {!isConnected && (
                  <p className="text-center text-gray-500 text-sm">
                    Connect wallet to purchase
                  </p>
                )}
              </form>
            )}
          </div>
        </div>

        {/* Charts and Info */}
        <div className="lg:col-span-2 space-y-6">
          {/* Launch Progress */}
          {!token.isLaunched && (
            <div className="card">
              <h3 className="text-lg font-semibold mb-4">Launch Progress</h3>
              
              <div className="space-y-4">
                <div>
                  <div className="flex justify-between text-sm text-gray-600 mb-2">
                    <span>XLM Raised: {token.xlmRaised} / {token.launchThresholdXlm}</span>
                    <span>{token.launchProgress}%</span>
                  </div>
                  <div className="w-full bg-gray-200 rounded-full h-3">
                    <div 
                      className="bg-blue-600 h-3 rounded-full transition-all"
                      style={{ width: `${token.launchProgress}%` }}
                    ></div>
                  </div>
                </div>

                <div className="grid grid-cols-2 gap-4 text-sm">
                  <div>
                    <div className="text-gray-600">Tokens Sold</div>
                    <div className="font-semibold">{token.tokensSold} / {token.totalSupply}</div>
                  </div>
                  <div>
                    <div className="text-gray-600">Remaining to Launch</div>
                    <div className="font-semibold">{(parseFloat(token.launchThresholdXlm) - parseFloat(token.xlmRaised)).toFixed(1)} XLM</div>
                  </div>
                </div>
              </div>
            </div>
          )}

          {/* Price Chart Placeholder */}
          <div className="card">
            <h3 className="text-lg font-semibold mb-4">Price Chart</h3>
            <div className="h-64 bg-gray-100 rounded-lg flex items-center justify-center">
              <div className="text-center text-gray-500">
                <div className="text-4xl mb-2">ðŸ“ˆ</div>
                <div>Price chart coming soon</div>
              </div>
            </div>
          </div>

          {/* Token Information */}
          <div className="card">
            <h3 className="text-lg font-semibold mb-4">Token Information</h3>
            
            <div className="space-y-3 text-sm">
              <div className="flex justify-between">
                <span className="text-gray-600">Total Supply:</span>
                <span className="font-medium">{token.totalSupply} {token.symbol}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-600">Tokens Sold:</span>
                <span className="font-medium">{token.tokensSold} {token.symbol}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-600">XLM Raised:</span>
                <span className="font-medium">{token.xlmRaised} XLM</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-600">Launch Threshold:</span>
                <span className="font-medium">{token.launchThresholdXlm} XLM</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-600">Creator:</span>
                <span className="font-mono text-xs">{token.creatorAddress.slice(0, 8)}...{token.creatorAddress.slice(-8)}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-600">Contract:</span>
                <span className="font-mono text-xs">{token.contractAddress.slice(0, 8)}...{token.contractAddress.slice(-8)}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-600">Created:</span>
                <span className="font-medium">{new Date(token.createdAt).toLocaleDateString()}</span>
              </div>
            </div>
          </div>

          {/* Recent Transactions Placeholder */}
          <div className="card">
            <h3 className="text-lg font-semibold mb-4">Recent Transactions</h3>
            <div className="text-center py-8 text-gray-500">
              <div className="text-2xl mb-2">ðŸ“‹</div>
              <div>Transaction history coming soon</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
